    detail_url = 'http://www.chinadrugtrials.org.cn/clinicaltrials.searchlistdetail.dhtml'
    detail_common_args = '&sort=desc&sort2=&rule=CTR&secondLevel=0&currentpage=1&keywords=&reg_no=&indication=&case_no=&drugs_name=&drugs_type=&appliers=&communities=&researchers=&agencies=&state='

    get_cookie_url = 'http://127.0.0.1:8080/review_cookie'
    get_detail_cookie_url = 'http://127.0.0.1:8080/review_detail_cookie'

    def main(self):

        req_url = "http://www.chinadrugtrials.org.cn/clinicaltrials.searchlist.dhtml"

        resp_first = requests.get(req_url, headers=self.headers)
        match = re.search(r"<script type=\"text/javascript\" src=\".*js.*?\".* r='m'></script>", resp_first.text)
        if not match:
            raise Exception('获取检索页面异常')
        # 获取首页，用来还原混淆字符串
        content = resp_first.text.replace(match.group(0), self.replace_cnt)
        pre_cookies = resp_first.cookies.get_dict()

        body = {'html_text': content, 'req_url': req_url}

        resp_second = requests.post(self.get_cookie_url, data=body)
        print('获取检索页Cookie：', resp_second.text)

        if not resp_second.text:
            print('获取cookie失败')
            return

        s_cookie = [key for key in resp_first.cookies.keys() if key.endswith('S')][0]
        t_cookie = json.loads(resp_second.text)['cookie'].split(";")[0].split("=")

        cookies = {s_cookie: pre_cookies[s_cookie], t_cookie[0]: t_cookie[1]}
        print('请求检索页的最终 Cookie：', cookies)

        resp_third = requests.get(req_url, headers=self.headers, cookies=cookies)
        with open(self.result_path, 'w') as f:
            f.write(resp_third.text)
        if resp_third.status_code != 200:
            print('请求检索页状态：', resp_third.status_code)
            return
        self.parse_menu(response=resp_third)
        print('结束')

    def parse_menu(self, response):
        selector_new = etree.HTML(response.text)
        all_trs = selector_new.xpath('//table[@class="searchTable"]//tr')
        for tr in all_trs[1:]:
            all_tds = tr.xpath('td')

            info = {
                'seq': format_crawled_value(all_tds[0].xpath('string(.)')),
                'register_number': format_crawled_value(all_tds[1].xpath('string(.)')),
                'test_condition': format_crawled_value(all_tds[2].xpath('string(.)')),
                'drug_name': format_crawled_value(all_tds[3].xpath('string(.)')),
                'indications': format_crawled_value(all_tds[4].xpath('string(.)')),
                'experimental_popular_topic': format_crawled_value(all_tds[5].xpath('string(.)')),
            }

            detail_args = {
                'id': all_tds[1].xpath('a/@id'),
                'ckm_index': all_tds[1].xpath('a/@name')
            }

            response_detail = self.request_detail_page(response, detail_args)

            info = self.parse_detail(response_detail, info)

    def request_detail_page(self, menu_response, detail_args):
        payload = urllib.parse.urlencode(detail_args) + self.detail_common_args

        selector = etree.HTML(menu_response.text)
        replace_cnt_list = [cnt.xpath('string(.)') for cnt in selector.xpath('//body//script')]
        content = menu_response.text
        for match in replace_cnt_list:
            content = content.replace(match, '')  # 替换 jQuery 代码段
        match = re.search(r"<script type=\"text/javascript\" src=\".*js.*?\".* r='m'></script>", content)  # 替换外连接js
        if not match:
            raise Exception('获取详情页面异常')
        content = content.replace(match.group(0), self.detail_replace_cnt)

        print('替换完成，写入文件：', self.detail_request_html_path)
        with open(self.detail_request_html_path, 'w') as f:
            f.write(content)

        request_cookie = menu_response.request._cookies.get_dict()
        response_cookie = menu_response.cookies.get_dict()
        cookies = {**request_cookie, **response_cookie}

        body = {'html_text': content, 'req_url': self.detail_url}
        resp_second = requests.post(self.get_detail_cookie_url, data=body)
        print('获取详情页Cookie：', resp_second.text)
        t_cookie = json.loads(resp_second.text)['cookie'].split(";")[0].split("=")
        cookies[t_cookie[0]] = t_cookie[1]
        print('请求详情页最终的Cookie：', cookies)

        response_detail = requests.post(url=self.detail_url, data=payload, cookies=cookies, headers=self.headers)
        print(response_detail,'********')
        return response_detail

    def parse_detail(self, response, info):
        content = response.text
        # with open(self.result_path) as f:
        #     content = f.read()

        selector_new = etree.HTML(content)

        base_info_section = selector_new.xpath('//div[@class="panel panel-default"]')[0]
