    def trial_group_info_handler(self, selector):
        result = []
        all_trs = selector.xpath('//tr')
        for tr in all_trs[1:]:
            all_tds = tr.xpath('td')
            if len(all_tds) == 1:
                continue
            result.append({
                'seq': all_tds[0].xpath("string(.)").strip(),
                'name': all_tds[1].xpath("string(.)").strip(),
                'usage': all_tds[2].xpath("string(.)").strip(),
            })
        return result

